import{_ as o,o as t,c as s,z as e,a}from"./chunks/framework.9482e208.js";const v=JSON.parse('{"title":"§ 53.1-133.6 Restriction on sale of jail industry program goods and services; print shop.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/53.1-133.6.md","filePath":"vacode/53.1-133.6.md"}'),n={name:"vacode/53.1-133.6.md"},r=e("h1",{id:"§-53-1-133-6-restriction-on-sale-of-jail-industry-program-goods-and-services-print-shop",tabindex:"-1"},[a("§ 53.1-133.6 Restriction on sale of jail industry program goods and services; print shop. "),e("a",{class:"header-anchor",href:"#§-53-1-133-6-restriction-on-sale-of-jail-industry-program-goods-and-services-print-shop","aria-label":'Permalink to "§ 53.1-133.6 Restriction on sale of jail industry program goods and services; print shop."'},"​")],-1),i=e("p",null,"A. Articles produced or manufactured and services provided by participants in jail industry programs may be disposed of by the sheriff or jail superintendent by sale only to municipal and county agencies in Virginia and to federal, state and local public agencies within or without the Commonwealth. Except as otherwise provided, no articles produced or manufactured nor services provided by prisoners may be bought, sold or acquired by exchange on the open market.",-1),d=e("p",null,"B. The products of any printing shop in a jail industry program shall be sold only to the departments, institutions and agencies of the Commonwealth which are supported in whole or in part with funds from the state treasury and to offices or agencies of the counties, cities and towns of the Commonwealth. Such products shall not be sold on the open market.",-1),c=e("p",null,"1992, c. 859.",-1),p=[r,i,d,c];function l(h,u,m,f,_,g){return t(),s("div",null,p)}const b=o(n,[["render",l]]);export{v as __pageData,b as default};
